import "./App.css";
import React, { useState, useEffect } from "react";
import Header from "./Header";
import Overview from "./Overview";

function App() {
  const [selectedTopic, setSelectedTopic] = useState("&category=general");
  const [selectedQuestion, setSelectedQuestion] = useState("");

  const changeSelectedTopic = (topic) => {
    setSelectedTopic(topic);
  };

  const changeSelectedQuestion = (region) => {
    setSelectedQuestion(region);
  };

  return (
    <div className="App">
      <Header onSelectedTopicChange={changeSelectedTopic} />
      <Overview selectedTopic={selectedTopic} />
    </div>
  );
}

export default App;
